const PDFDocument = require('pdfkit-table')

async function buildPDF(dataCallback, endCallback) {
  const doc = new PDFDocument({ margin: 30, size: 'A4' })

  doc.on('data', dataCallback)
  doc.on('end', endCallback)

  // start pdf document
  // to save on server

  // json file
  const json = require('./table.json')

  // -----------------------------------------------------------------------------------------------------
  // Simple Table with Array
  // -----------------------------------------------------------------------------------------------------
  // AÃ±adir la imagen
  const base64Image =
    'data:image/jpg;base64, ' // Tu cadena de imagen en base64

  const imageBuffer = Buffer.from(base64Image.split(',')[1], 'base64')
  doc.image(imageBuffer, 50, 50, { width: 120 })

  // Dibujar rectÃ¡ngulos de fondo
  doc.rect(200, 50, 300, 25).fill('#507690').stroke()
  doc.rect(200, 75, 100, 25).fill('#507690').stroke()
  doc.rect(200, 100, 100, 25).fill('#507690').stroke()
  doc.rect(200, 125, 100, 25).fill('#507690').stroke()

  // AÃ±adir texto del tÃ­tulo
  doc.fill('#FFFFFF')
  doc.fontSize(12).text('REPORTE DE FLUJOS POR REGLAMENTO', 205, 55)

  // AÃ±adir el resto del texto
  doc.fontSize(10).fill('#FFFFFF').text('Sistema:', 205, 80)
  doc.fill('#000000').text('GABINETE JURIDICO VIRTUAL', 310, 80)

  doc.fontSize(10).fill('#FFFFFF').text('Fecha ImpresiÃ³n:', 205, 105)
  doc.fill('#000000').text('15/12/18', 310, 105)

  doc.fontSize(10).fill('#FFFFFF').text('Usuario:', 205, 130)
  doc.fill('#000000').text('NO USER', 310, 130)

  // Finalizar el documento
  doc.end()
}

module.exports = { buildPDF }
